script: |
  super -f text -I q12250.spq | sort > q12250.out

inputs:
  - name: q12250.spq
    data: |
      SELECT DISTINCT col1 FROM tab2 (FORMAT parquet) WHERE NOT - col1 * + - 72 BETWEEN - - 29 AND col0 / + 58 + + col2;
  - name: tab2

outputs:
  - name: q12250.out
    data: |
      51
      67
      77
